import React, {Component} from 'react';
import skills from './skills'
import battleData from './battleData'

class Skills extends Component{
    // constructor(){
    //     super();
    // }

    render(){
        const battleRow = battleData.map((skill,i)=>{
            return(
                <tr key={i}>
                    <td>{skill.name}</td>
                    <td>{skill.initValue}</td>
                    <td><input /></td>
                    <td><input /></td>
                    <td><input /></td>
                    <td><input /></td>
                    <td><input /></td>
                </tr>
            )
        })

        const skillRow = skills.map((skill,i)=>{
            return(
                <tr key={i}>
                    <td>{skill.category}</td>
                    <td>{skill.name}</td>
                    <td>{skill.initValue}</td>
                    <td><input /></td>
                    <td><input /></td>
                    <td><input /></td>
                    <td><input /></td>
                    <td><input /></td>
                </tr>
            )
        })

        return(
            <div>
                <h2>Sample</h2>
                <table>
                    <tr>
                        <td>技能名</td>
                        <td>初期値</td>
                        <td>職業P</td>
                        <td>興味P</td>
                        <td>成長</td>
                        <td>その他</td>
                        <td>合計値</td>
                    </tr>
                    <battleRow />
                </table>

                <table>
                    <tr>
                        <td>カテゴリ</td>
                        <td>技能名</td>
                        <td>初期値</td>
                        <td>職業P</td>
                        <td>興味P</td>
                        <td>成長</td>
                        <td>その他</td>
                        <td>合計値</td>
                    </tr>
                    <battleRow />
                    {skillRow}
                </table>
            </div>
        )
    }
}

export default Skills;
